import React from 'react'
import "./Modal.css"

function Modal({active,setActive}) {
  return (
    <div className={active ? "modal active" : "modal"} onClick={()=>setActive(false)}>
        <div className='modal_content' onClick={e => e.stopPropagation()} >
            <div>Modal</div>
        </div>
    </div>
  )
}

export default Modal
